import React from "react";
import {observer} from "mobx-react-lite";

interface Props {
    id: number;
}

const BookItem: React.FC<Props> = observer((props) => {
    const myBook={
        kind: "books#volume",
        id: "AQCfDwAAQBAJ",
        etag: "el7gHLNWCRk",
        selfLink: "https://www.googleapis.com/books/v1/volumes/AQCfDwAAQBAJ",
        volumeInfo: {
            title: "{Вы не знаете JS} Типы и грамматические конструкции",
            authors: [
                "Симпсон Кайл"
            ],
        }
    };
    return (
        <div className="container">
            Hello world{myBook.volumeInfo.title}
        </div>
    );
})

export default BookItem;
